import { Button, Modal } from "react-bootstrap/";

const ModalWindowAddToFavorites = ({
  selectedPosts,
  isVisabilityModalOfFavorities,
  setIsVisabilityModalOfFavorities,
  handleAddMultiplyToFavorities,
}) => {
  if (!isVisabilityModalOfFavorities) {
    return null;
  }
  console.log(selectedPosts);

  return (
    <div>
      <div
        style={{
          position: "fixed",
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: "rgba(0, 0, 0, 0.5)",
          zIndex: 1040,
        }}
      ></div>

      <div
        className="modal show"
        style={{ display: "block", position: "fixed", zIndex: 1050 }}
      >
        <Modal.Dialog>
          <Modal.Header
            closeButton
            onClick={() => setIsVisabilityModalOfFavorities(false)}
          ></Modal.Header>
          <Modal.Body>
            <p className="text-center m-0">
              Are you sure you want to add the posts in favorities?
            </p>
          </Modal.Body>
          <Modal.Footer>
            <Button
              variant="secondary"
              onClick={() => {
                setIsVisabilityModalOfFavorities(false);
              }}
            >
              NO
            </Button>
            <Button
              variant="primary"
              onClick={() => {
                handleAddMultiplyToFavorities(...selectedPosts);
                setIsVisabilityModalOfFavorities(false);
              }}
            >
              YES
            </Button>
          </Modal.Footer>
        </Modal.Dialog>
      </div>
    </div>
  );
};

export default ModalWindowAddToFavorites;
